import React from 'react';
import CartItem from './CartItem';

export default function CartList({value}) {


    console.log('cart:',value);
    return (
        <div className="container-fluid">
            {value.map(item=>{
                return(
                    <CartItem key={item.id} item={item} value={value}/>
                );
            })
            }
        </div>
    )
}
